import "./scss/app.scss";
import Home from "./components/Home";
import { Route, Routes } from "react-router-dom";
import OneMedicineBlock from "./pages/OneMedicineBlock/OneMedicineBlock";
import Header from "./components/Header";
import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Cart from "./pages/Cart/Cart";
import { useSelector } from "react-redux";
function App() {
  const isModal = useSelector(state => state.filterSlice.isModal)
  console.log(isModal)

  return (
    <>
      <div className={!isModal ? 'scroll_no' : 'wrapper'}>
        <Header />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/medicine/:id" element={<OneMedicineBlock />} />
          <Route path="/cart" element={<Cart />} />
        </Routes>
      </div>
    </>
  );
}

export default App;
